import './TeamCard.scss'

function TeamCard ({className, taskDisplayTeam, strTeamBadge}) {

    return (
        <article className={`${className} card`} onClick={() => taskDisplayTeam(team.idTeam)}>
            <img className="card__img" src={strTeamBadge} alt="team" />
        </article>
    )
};

export default TeamCard;
